// src/components/admin/LatestTable.jsx
import PropTypes from "prop-types";

const LatestTable = ({
  title,
  data,
  columns,
  onAdd,
  onEdit,
  onDelete,
  onView,
  type = "primary",
  maxRows = 6,
}) => {
  const typeClasses = {
    users: "users",
    categories: "categories",
    products: "products",
    customers: "customers",
    orders: "orders",
    employees: "employees",
    sales: "sales",
    reservations: "reservations",
  };

  const iconMap = {
    users: "üë•",
    categories: "üìÅ",
    products: "üì¶",
    customers: "üë§",
    orders: "üõí",
    employees: "üíº",
    sales: "üìà",
    reservations: "üìÖ",
  };

  const displayColumns = columns.slice(0, 4); // ÿπÿ±ÿ∂ 4 ÿ£ÿπŸÖÿØÿ© ŸÉÿ≠ÿØ ÿ£ŸÇÿµŸâ

  return (
    <div className={`table-container ${typeClasses[type] || "primary"}`}>
      <div className="table-header">
        <h3>
          {iconMap[type] || "üìä"} {title}
          <span
            style={{ fontSize: "0.9rem", opacity: 0.9, marginLeft: "0.5rem" }}
          >
            ({data.length} items)
          </span>
        </h3>
        <div className="table-actions">
          <button className="action-btn" onClick={onAdd}>
            <span>+</span> Add New
          </button>
        </div>
      </div>
      <div className="table-content">
        {data.length > 0 ? (
          <table className="custom-table">
            <thead>
              <tr>
                {displayColumns.map((col) => (
                  <th key={col.key}>{col.label}</th>
                ))}
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {data.slice(0, maxRows).map((item, index) => (
                <tr key={index}>
                  {displayColumns.map((col) => (
                    <td key={col.key}>
                      {typeof item[col.key] === "object"
                        ? JSON.stringify(item[col.key]).substring(0, 20) + "..."
                        : String(item[col.key] || "-").substring(0, 30)}
                    </td>
                  ))}
                  <td className="table-actions-cell">
                    {onView && (
                      <button
                        className="icon-btn view"
                        onClick={() => onView(item)}
                        title="View Details"
                      >
                        üëÅÔ∏è
                      </button>
                    )}
                    {onEdit && (
                      <button
                        className="icon-btn edit"
                        onClick={() => onEdit(item)}
                        title="Edit"
                      >
                        ‚úèÔ∏è
                      </button>
                    )}
                    {onDelete && (
                      <button
                        className="icon-btn delete"
                        onClick={() => onDelete(item.id || item._id || index)}
                        title="Delete"
                      >
                        üóëÔ∏è
                      </button>
                    )}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <div className="no-data">
            <div className="no-data-icon">üìä</div>
            <h4>No Data Available</h4>
            <p>
              No records found. Click "Add New" to create your first record.
            </p>
          </div>
        )}
      </div>
    </div>
  );
};

LatestTable.propTypes = {
  title: PropTypes.string.isRequired,
  data: PropTypes.array.isRequired,
  columns: PropTypes.array.isRequired,
  onAdd: PropTypes.func,
  onEdit: PropTypes.func,
  onDelete: PropTypes.func,
  onView: PropTypes.func,
  type: PropTypes.string,
  maxRows: PropTypes.number,
};

export default LatestTable;
